        'Agriculture': 0.5,
        'Construction': 0.5
    },
    'Appliance': {
        'Electric': 0.5,
        'Furniture': 0.2,
        'Construction': 0.3
    },
    'AlFi': {
        'Metals': 0.25,
        'Electronic': 0.15,
        'Construction': 0.6
    },
    'CF': {
        'Oil & Gas': 0.05,
        'Metals': 0.05,
        'Electric': 0.05,
        'Auto Production': 0.65,
        'Construction': 0.2
    },
    'Food': {
        'Agriculture': 0.3,
        'Food': 0.7
    },
    'Aero': {
        'Transportation': 0.1,
        'Air Bus': 0.5,
        'Boeing': 0.1,
        'MRO': 0.3
    }
}

# Load the workbook and read raw data
wb = load_workbook('/workspace/dumps/workspace/Market_Data.xlsx', data_only=True)
raw_sheet = wb['RawData']

# Extract headers from row 4 (market categories)
headers = []
for col in range(2, 17):  # B to P columns
    cell_value = raw_sheet.cell(row=4, column=col).value
    if cell_value:
        headers.append(cell_value)

# Extract yearly data
raw_data = {}
for row in range(5, 24):  # Rows 5 to 23 (2014-2032)
    year = raw_sheet.cell(row=row, column=1).value
    if year:
        year_data = {}
        for col_idx, header in enumerate(headers):
            col = col_idx + 2  # Adjust for column offset
            value = raw_sheet.cell(row=row, column=col).value
            if value is not None and not isinstance(value, str):  # Skip formulas and null values
                year_data[header] = float(value)
            else:
                year_data[header] = 0.0
        raw_data[year] = year_data

# Convert raw market data to internal categories
converted_data = {}
for year, market_data in raw_data.items():
    internal_data = {}

    # Calculate each internal category based on the conversion matrix
    for internal_cat, market_mapping in conversion_matrix.items():
        total_value = 0.0

        for market_cat, weight in market_mapping.items():
            if market_cat in market_data:
                total_value += market_data[market_cat] * weight

        internal_data[internal_cat] = total_value

    converted_data[year] = internal_data

# Focus on Appliance category for growth rate calculation
appliance_data = {}
for year in sorted(converted_data.keys()):
    appliance_data[year] = converted_data[year]['Appliance']

print("Appliance category data by year:")
for year in sorted(appliance_data.keys()):
    print(f"  {year}: {appliance_data[year]:,.2f}")

# Filter data for 2015-2024 for growth rate calculation
years_2015_2024 = [year for year in sorted(appliance_data.keys()) if 2015 <= year <= 2024]
appliance_2015_2024 = {year: appliance_data[year] for year in years_2015_2024}

print(f"\nAppliance data for 2015-2024:")
for year in years_2015_2024:
    print(f"  {year}: {appliance_2015_2024[year]:,.2f}")

print(f"\nYears available for analysis: {years_2015_2024}")"}

